2019 hasty decision: bryce dallas howard is woman of the year: the country's oldest theatrical organization, harvard university's hasty pudding theatricals, this year honors the "jurassic world" and "the twilight" saga star ... howard, also the daughter of actor-director ron ("happy days," "solo: a star wars story"), earned her coveted pot by going back to the future to acting school, taking on a velociraptor in basketball and giving her "enemy," gluten, a pie in the face ... â€œi will never forget this as long as i live, and please accept my children into harvard,â€ she said during her acceptance speech ... perhaps inspired by the #metoo movement, hasty pudding theatricals this year included females in its casting for the first time since 1844, re-upping an old practice that will continue ... the annual award recognizesÂ performers who have made lasting and impressive contributions to the world of entertainment ... photos by paul marotta/getty images for hasty pudding institute of 1770.
